import "./style.css";
import React, {Component, useState} from "react";

const App = () => {
  const [name,setName]=useState("");
  const [email,setEmail]=useState("");
  const [gender,setGender]=useState("");
  const [phone,setPhone]=useState("");
  const [passward,setPassward]=useState("");
  const [list,setList]=useState([]);
const signForm=(e)=>{
   e.preventDefault();
   const newlist={name,email,gender,phone,passward};
   setList([...list,newlist]);
   console.log(list);
}

  return (
    <div id="main">
      <h1> SignUp Form</h1>
       <form action="" onSubmit={signForm}>
         <lable htmlFor="name" >Name</lable>
         <input data-testid="name" value={name} onChange={(e)=>setName(e.target.value)} /> <br/><br/>
         <lable htmlFor="email">Email</lable>
         <input data-testid ="email" value={email} onChange={(e)=>setEmail(e.target.value)}  /> <br/><br/>
         <select data-testid = 'gender' >
            <option >Select the Gender</option>
            <option data-testid = 'male' value={gender} onSelect={(e)=>setGender(e.target.value)} >Male</option>
            <option data-testid = 'female' value={gender} onSelect={(e)=>setGender(e.target.value)} >Female</option>
            <option data-testid = 'others' value={gender} onSelect={(e)=>setGender(e.target.value)} >Others</option>
         </select><br/><br/>
         <lable htmlFor="phoneNumber">Phone Number</lable>
         <input data-testid = 'phoneNumber' value={phone} onChange={(e)=>setPhone(e.target.value)}  /> <br/><br/>
         <lable htmlFor="passward">Passward</lable>
         <input data-testid ='password'type='password' value={passward} onChange={(e)=>setPassward(e.target.value)} /> <br/><br/>
      </form>
      <button data-testid="submit">Submit</button>
    </div>
  )
}

export default App;
